import React from "react";
import { connect } from "react-redux";
import {getSemester, deleteSemester} from "../../reduser/data-reduser.js";
import Semester from "./Semester.jsx";


class SemesterContainer extends React.Component {
    componentDidMount() {
        this.props.getSemester();
    }
    render() {
        return <Semester semester={this.props.semester} deleteSemester={this.props.deleteSemester} />;
    }
}


const mapStateToProps = (state) => ({
  semester: state.data.semester,
});

export default connect(mapStateToProps, { getSemester, deleteSemester })(SemesterContainer);
